ISLAMABAD, Dec 21 (APP): Caretaker Minister for Privatisation and Inter-Provincial Coordination Fawad Hassan Fawad called on Caretaker Prime Minister Anwaar-ul-Haq Kakar here on Thursday.
The Caretaker Minister for Privatisation and Inter-Provincial Coordination briefed the Prime Minister about privatisation process of the State-Owned Enterprises (SOEs).
